      out.write("<h2>About OâNeill</h2>\r\n");
      out.write("<div class=\"hidden-xs\"><p>O'Neill, the original California surf, snow and youth lifestyle brand, was founded in 1952 when a young man named Jack O'Neill took his unstoppable passion for surfing and used it to beat Mother Nature at her own game. Pioneering the first neoprene surfing wetsuit, Jack had successfully found a way to extend his surf sessions in the bone-chilling breaks of Northern California. He opened up the garage doors to his first surf shop in Santa Cruz soon after.</p>\r\n");
      out.write("</div>\r\n");
      out.write("<div id=\"about-callout-text\" class=\"collapse\">\r\n");
      out.write("<div class=\"visible-xs\"><p>O'Neill, the original California surf, snow and youth lifestyle brand, was founded in 1952 when a young man named Jack O'Neill took his unstoppable passion for surfing and used it to beat Mother Nature at her own game. Pioneering the first neoprene surfing wetsuit, Jack had successfully found a way to extend his surf sessions in the bone-chilling breaks of Northern California. He opened up the garage doors to his first surf shop in Santa Cruz soon after.</p>\r\n");
      out.write("</div>\r\n");
      out.write("<p>While many things have changed since those humble beginnings, Jack's initial vision of producing functional and innovative board riding products continues to lie at the core of everything the company does. O'Neill's core valuesâinnovation in style and technologyâhave seen the brand devote itself wholeheartedly to the evolution of the action sports lifestyle. From the first line of surfing wetsuits and surf leash, to the world's first stitchless boardshorts, and range of groundbreaking wearable electronics, O'Neill's progressive spirit will always drive the company forward.</p>\r\n");
      out.write("</div>\r\n");
